// 1. Obtener el HTML de entrada
const html = $json.data || '';
const url = $json.url || 'URL desconocida';

// --- FUNCIÓN 1: DESCIFRAR CLOUDFLARE (El truco ninja) ---
// Muchas webs muestran [email protected] en el código fuente.
// Esta función toma el código hexadecimal y devuelve el email real.
function decodeCfEmail(encodedString) {
    let email = "";
    let r = parseInt(encodedString.substr(0, 2), 16);
    for (let n = 2; n < encodedString.length; n += 2) {
        let c = parseInt(encodedString.substr(n, 2), 16) ^ r;
        email += String.fromCharCode(c);
    }
    return email;
}

// --- FUNCIÓN 2: LIMPIEZA PREVIA ---
// Reemplazamos entidades comunes que rompen la regex
let cleanHtml = html
    .replace(/&#64;/g, '@')   // Reemplaza entidad HTML de @
    .replace(/%40/g, '@')     // Reemplaza URL encode de @
    .replace(/\(at\)/gi, '@') // Reemplaza (at) por @
    .replace(/\[at\]/gi, '@'); // Reemplaza [at] por @

// 2. BUSCAR CORREOS DE CLOUDFLARE
// Buscamos patrones data-cfemail="..."
let cfEmails = [];
const cfRegex = /data-cfemail="([a-f0-9]+)"/g;
let cfMatch;
while ((cfMatch = cfRegex.exec(cleanHtml)) !== null) {
    cfEmails.push(decodeCfEmail(cfMatch[1]));
}

// 3. BUSCAR CORREOS ESTÁNDAR (REGEX MEJORADA)
// Esta regex es más permisiva pero luego filtraremos la basura.
// Busca mailto: o texto plano.
const standardRegex = /([a-zA-Z0-9._-]+@[a-zA-Z0-9._-]+\.[a-zA-Z0-9_-]+)/gi;
let standardMatches = cleanHtml.match(standardRegex) || [];

// 4. UNIR Y FILTRAR (La parte importante)
let allEmails = [...cfEmails, ...standardMatches];

// Lista de extensiones que parecen emails pero NO lo son (imágenes, scripts)
const junkExtensions = ['.png', '.jpg', '.jpeg', '.gif', '.svg', '.webp', '.js', '.css', '.woff', '.ttf', '.mp4'];

// Proceso de limpieza final
const uniqueValidEmails = [...new Set(allEmails)] // Eliminar duplicados
    .map(email => email.toLowerCase().trim()) // Todo a minúsculas y sin espacios
    .filter(email => {
        // Filtro 1: Debe tener un @ y un punto
        if (!email.includes('@') || !email.includes('.')) return false;

        // Filtro 2: No debe ser demasiado largo (spam/garbage strings)
        if (email.length > 50) return false;

        // Filtro 3: No debe terminar en extensiones de archivo (ej. logo@2x.png)
        const extension = email.substring(email.lastIndexOf('.'));
        if (junkExtensions.includes(extension)) return false;

        return true;
    });

// 5. RETORNAR RESULTADO
return [{
    json: {
        url: url,
        emails_found: uniqueValidEmails.length > 0 ? uniqueValidEmails : ['No encontrado'],
        count: uniqueValidEmails.length
    }
}];

