// 1. Obtener el texto crudo de la IA
const raw = $json.content || $json.message?.content || $json.text || '';

// 2. Limpieza de Markdown si la IA desobedece y pone bloques de código
// Eliminamos ```html al principio y ``` al final si existen
let cleaned = raw.replace(/^```html\s*/i, '').replace(/^```\s*/i, '').replace(/```\s*$/i, '');

// 3. Limpieza de espacios extra
cleaned = cleaned.trim();

// 4. Retornar el HTML listo para Gmail
// Al ser HTML básico (<p> y <br>), Gmail lo renderizará como texto normal con espaciado correcto.
return [{
    json: {
        html_body: cleaned
    }
}];
